import React from 'react';
import Loadable from '@/components/Loadable'

const Hook = Loadable(() => import('@/pages/Shop'))
const Home = Loadable(() => import('@/pages/Home'))
const Tab = Loadable(() => import('@/pages/Types'))
export {
    Tab,
    Home,
    Hook
}
